SA Ida-Viru Keskhaigla on Ida-Virumaa suurim haigla, mille koosseisus on kirurgia-, sise-, hamba- ning taastus- ja hooldusravikliinik ning kaheksa meditsiinilist teenistust. Ida-Viru Keskhaigla arstid võtavad vastu maakonna polikliinikutes Kohtla-Järve Järve ja Ahtme linnaosas ning Kiviõlis ja Sillamäel. Haigla teenindab ligi 175 000 elanikuga piirkonda ning annab tööd enam kui 1000-le töötajale. Haigla nõukogus on võrdselt esindatud Kohtla-Järve linn ja Tartu Ülikooli Kliinikum.
Ida-Viru Keskhaigla, Narva Haigla ja Tartu Ülikooli Kliinikum on sõlminud kolmepoolse kliinilise koostöö kokkuleppe patsientide raviks Ida-Virumaal.
Klikkides kaardile, avaneb see suuremalt.
SA Ida-Viru Keskhaiglale on väljastatud järgmised tegevusload:
- L02950 hambaraviteenused, ortodontiateenused;
- L03923 iseseisev statsionaarne õendusabiteenus, voodikohti 50;
- L03842 ambulatoorsed kardiovaskulaarkirurgia teenused;
- L03456 koolitervishoiuteenus;
- L02987 teised eriarsti teenused.
SA Ida-Viru Keskhaigla ning Eesti Haigekassa vahel on sõlmitud ravi rahastamise leping nr 61205 14.

GP Systems tegeleb erinevate antennide paigaldamisega juba alates 2005. aastast, olles selle ajaga omandanud palju kogemusi ja loonud laialdast teadmiste pagasi selle valdkonna spetsiifikast. GP Systems omab kogemusi mobiilside operaatorite, Internetiteenuste pakkujate, turvafirmade, televisiooni, kui ka teiste ettevõtete ja üksikisikute soovidega selles valdkonnas.
Lühikese ajaga koostame pakkumise Teile vajaliku antenni paigaldamiseks, samuti tarnime maste, tugi- või muid konstruktsioone.
Pakume NEC, Ceragon, Motorolla, MikroTik, samuti mistahes muud teie valitud antennid. Pakume individuaalset lähenemist nii üksikisikutele kui mistahes suurusega ettevõtetele ja riigiasutustele.
Pakume
- Füüsilist asukoha läbivaatust;
- Maastikureljeefi ja kõrguse määramist elektrooniliselt vastavalt GPS koordinaatidele;
- Projekteerimistöid ja nende täieliku kooskõlastamist ja kinnitamist vastutavate asutuste poolt;
- Vajalike materjalide ja komplektis olevate seadmete hanget, tarnet ja paigaldamist;
- Antennide paigaldamist ja montaaži;
- Vajaliku tarkvara paigaldamist ja seadistamist;
- Antennide katsetamist ja kasutuselevõtmist;
- Garantiiteenindust;
- Kiiret ja tõhusat rikete kõrvaldamist.
Kõik antennide projekteerimis- ja paigaldamise/ehitustöid teostatakse Euroopa standardi- ja tehnoloogianõuete kohaselt. Ootamatute vigade ja probleemide korral saab teha ka kaugdiagnostikat.

Uus WordPress 2.1 Ella (Ella Fitzgerald'i järgi) on valmis. Uues versioonis on hulgaliselt uuendusi, näiteks:
- Autosave - automaatne postituste salvestamine;
- Uus editor - kiire ümberlülitamine WYSIWYG ja koodi vahel;
- XML import/eksport – andmete vahetamiseks erinevate WordPress blogide vahel;
- Õigekirja kontroll;
- Lingid saab nüüd kategooriatesse jagada;
- Uus Akismet plugin;
- Ja palju muud.
