te kategooriavärkide stiili on kõvasti ühtlustatud.
Peab ka mõne aja pärast kui kõik ilusti toimib selle uuenduse ära tegema. Aga kas uues versioonis saab juba ka embed tagiga videosid postitada? Vanemate versioonide wysiwyg paneb mõnuga näkku.
Uuema versiooni WYSIWYG-editor on minumeelest halvem. Vanemas sai oma postituse HTML koodi vaadata ja muuta. Uues ma seda võimalust veel leidnud ei ole. Tunnen sellest juba tõsiselt puudust.
Esialgu peale installi ei pannud kohe tähelegi. Nüüd olen hädas.
